"刘思思的故事":["","刘思思的故事",
"刘思思从小受到的教育就是：凡事都要争第一。她也没让父母失望，总能成为同龄人中最优秀的那个。<br>"+
"不光是学习成绩好，在班级里总是能得到同学们的喜爱，比如过生日那天总能收到同学们送的堆成小山的礼物，这是班里独一份的待遇。<br>"+
"可到了高中一切都不一样了，学习压力加重，人际交往也变得更加复杂，她渐渐的不再是那个最优秀的孩子。<br>"+
"情窦初开的年纪，她没有喜欢哪个男生，她觉得应该是男生们都来追求她，而她则勉为其难的选择其中最帅的那个。<br>"+
"可现实是男生们更喜欢那个班花，刘思思觉得自己才应该是班花，应该享受同学们的追捧。<br>"+
"她试过耍手段，比如班里有个男生明明长得很可爱，在女生中有着很高的人气，却很少与人接触，总是一副生人勿近的样子，正好可以利用一下。刘思思暗中传播那个男生喜欢自己的传闻，让女生嫉妒，让男生觉得她是有魅力的。<br>"+
"这些手段起到了一些效果，可还远远不够，刘思思总是苦于想不出更好的办法。<br>"+
"为了和同学搞好关系，她开始尝试当下最流行的角色扮演游戏《虚拟裂痕》。<br>"+
"一次，她遇到了一个水仙花脑袋的NPC，对方说可以让她许一个愿望，她想着只是个游戏而已，随口说了想成为学校里最受欢迎的人，NPC接下了愿望。<br>"+
"没想到的是，接下来的几天在班里明显感觉到自己更受欢迎了。<br>"+
"NPC告诉她，这个愿望需要一些时间，还需要刘思思配合，比如要服下可以增长魅力的药，还说如果能让同学也来玩这个游戏，把他们带到NPC这里，就有办法让这些同学忠诚于刘思思。<br>"+
"刘思思照做了，吃了几次药，刘思思觉得不够，她还想要更多。<br>"+
"终于有一天，NPC满足了她，一次给了足足五颗，将药服下，刘思思感觉意识变得模糊，身体和思想不受控制，但她在学校真的变得更受欢迎了，她很满意。<br>"+
"但她感觉到有另一个灵魂在占据自己的身体。<br>"+
"这天放学，刘思思来到NPC的据点游戏厅外，看到一个陌生的少女在和NPC召唤的守护者战斗，她的身体自己行动了起来，不知如何变出匕首射向那个少女。<br>"+
"然后，她看到了那个被自己利用的男生猫夏。<br>"+
